  false,\n\t\"url\": null,\n\t\"notes\": \"Limited presence/absence data on vegetation
  have been collected on Protection Island NWR. In order to more accurately document
  the impacts, distribution, and percent cover, baseline data on invasive species
  is needed prior to initiating proposed grassland restoration. In a 2008 study looking
  at historically changes of the vegetation on Protection Island it was found that
  only 41% of the island vegetation is native (Cowles, 2008). On the San Juan Island
  NWR, similar limited information exists that is 710years old. Gathering baseline
  data on these wilderness islands will guide refuge management on invasive species.
  Further, using volunteers to map, control, or eradicate these invasive species allow
  staff to better manage these remote refuge resources. Cowles, D.L. and Hayward,
  J.L., Historical Changesin the Physical and Vegetational Characteristics of Protection
  Island, Washington (2008)\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
